import React, { useState } from "react";
import Table_dar from "./Table_dar";
import Table_center from "./Table_center";
import Table_flesh from "./Table_flesh";
import Table_column from "./Table_column";

function Table(props){
    const [wlad_p, setWlad_p] = useState([true,true,true,true])
    const [wlad_s, setWlad_s] = useState([true,true,true,true])
   
    
    const tadkhal = ()=>{
        if( this.props.p.num === 6 && this.props.p.noba === true ){
            console.log(`Tableau Primary ghay7arak ghayzid ${this.props.p.num} and _666 : ${this.props.p._666.length}`)   
        }else if( this.props.s.num === 6 && this.props.s.noba === true ){
            console.log(`Tableau Success ghay7arak  ${this.props.s.num} and _666 : ${this.props.s._666.length}`)   
        }else if( this.props.p.num !== 6 && this.props.p.noba === false ){
            console.log(`Tableau Primary ghay7arak ${this.props.p.num} and _666 : ${this.props.p._666.length}`)  
            if (this.props.p.num === 5){
                if(wlad_p[0] ){ 
                    setWlad_p({wlad_p: [false,true,true,true]})
                }else if(wlad_p[1]){
                    this.setState({wlad_p: [false,false,true,true]})
                }else if(wlad_p[2]){
                    this.setState({wlad_p: [false,false,false,true]})
                }else if(wlad_p[3]){
                    this.setState({wlad_p: [false,false,false,false]})
                }
            }
        }else if( this.props.s.num !== 6 && this.props.s.noba === false  ){
            console.log(`Tableau Success ghay7arak ${this.props.s.num} and _666 : ${this.props.s._666.length}`)  
        }
    }

        return(
        <div className="Parchessi_design border border-dark">
            <Table_dar 
                classN="Primary-player" 
                bg="var(--primary)" 
                
            />
            <Table_dar 
                classN="Danger-player"  
                bg="var(--danger)" 
            />
            <Table_dar 
                classN="Success-player"  
                bg="var(--success)" 
                
            />
            <Table_dar 
                classN="Warning-player"  
                bg="var(--warning)" 
            />
            
            <Table_center />

            <Table_flesh 
                classN="Flesh-primary" 
                bgDirection="bg-primary" 
                childSecondary="Flesh_height_p border-bottom border-dark" 
                child="Flesh_height_p" 
                num="68" 
                borderDirection="border-bottom" 
            />

            <Table_flesh 
                classN="Flesh-danger" 
                bgDirection="bg-danger d-flex" 
                childSecondary="Flesh_height_d border-end border-dark" 
                child="Flesh_height_d" 
                num="17" 
                borderDirection="border-end" 
            />

            <Table_flesh 
                classN="Flesh-success" 
                bgDirection="bg-success d-flex flex-column flex-column-reverse" 
                childSecondary="Flesh_height_s_34 border-top border-dark" 
                child="Flesh_height_s" 
                num="34" 
                borderDirection="border-top" 
            />
            
            <Table_flesh 
                classN="Flesh-warning" 
                bgDirection="bg-warning d-flex flex-row-reverse" 
                childSecondary="Flesh_height_w border-start border-dark" 
                child="Flesh_height_w" 
                num="51" 
                borderDirection="border-start" 
            />

            <Table_column  style_column="column-top-8 d-flex flex-column-reverse"/>
            <Table_column  style_column="column-top-1"/>

            <Table_column  style_column="column-top-2 d-flex rtl"/>
            <Table_column  style_column="column-top-3 d-flex"/>

            <Table_column  style_column="column-top-4"/>
            <Table_column  style_column="column-top-5 d-flex flex-column-reverse"/>

            <Table_column  style_column="column-top-6 d-flex"/>
            <Table_column  style_column="column-top-7 d-flex flex-row-reverse"/>

        </div>
        )
}

export default Table;
